import React from "react";
import { Button } from "bumbag";

const ButtonUI = ({name}) => (
  <Button
    use="h3"
    fontWeight="bold"
    borderRadius="7"
    border="none"
    textTransform="uppercase"
    color="contrast"
    backgroundColor="primary"
  >
    {name}
  </Button>
);

export default Button;
